import React from 'react'
import NavbarButom from '../components/NavbarButom';
import NavbarTop from '../components/NavbarTop';
import { Container } from 'react-bootstrap';


const TheBrigadeHero = () => {
   const h1Style = {
              textTransform: "uppercase",
              fontFamily: "Anton, sans-serif",
              letterSpacing: "0.1em",
              fontSize: "9.5rem",
              color: "#000",
              wordWrap: "break-word",
  };
  return (
         <div
      style={{
        backgroundColor: "#3500ff",
        minHeight: "100vh",
        color: "white",
        padding: "2rem",
      }}>
      <Container fluid>
         <div>
              <h1 className="fw-bold text-end" style={h1Style}>
               THe Brigade
              </h1>
          </div>
        <NavbarTop />
        <NavbarButom />
      </Container>
    </div>
  )
}

export default TheBrigadeHero
